  author: michikora
  content: 'weiui get the same hash is not a bug, is to quickly calculate the hash
    so only a small part of the file header is used.

    It is possible that the header of file is same when appending training to an existing
    model or using add different to mix model.

    So it will make same hash, If you calculate the hash of the complete file, you
    can see the difference between the two files.

    You can see this link below for details.

    https://github.com/AUTOMATIC1111/stable-diffusion-webui/issues/271'
